import React from "react";

const CarouselOverlay = () => {
  return (
    <div
      style={{
        background: "rgba(0, 0, 0, 0.5)",
        position: "absolute",
        top: "0",
        bottom: "0",
        left: "0",
        right: "0",
      }}
    ></div>
  );
};

export default CarouselOverlay;
